import React from "react";
import { Button } from "../Button";
import "./About.css";
import "../../App.css";

function About() {
  return (
    <div className="about-container">
      <video src="/videos/video-1.mp4" autoPlay loop muted />
      <h2>Me, Myself, & I</h2>
    </div>
  );
}

export default About;
